import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import DatePicker from "react-datepicker";
import datePicker from "./navbar.module.css";

export default function ButtonAppBar({
  setAPODStartDate,
  setAPODEndDate,
  setAPOD,
  startDate,
  endDate,
}) {
  const SelectStartDate = () => {
    const selectNewStartDate = (date) => {
      setAPODStartDate(date);
      setAPOD([]);
    };

    const selectNewEndDate = (date) => {
      setAPODEndDate(date);
      setAPOD([]);
    };

    return (
      <div>
        <DatePicker
          selected={startDate}
          onChange={(date) => selectNewStartDate(date)}
        />
        <DatePicker
          selected={endDate}
          onChange={(date) => selectNewEndDate(date)}
        />
      </div>
    );
  };

  return (
    <div>
      <header className="Navbar">
        <div className="Toolbar">
          <div className="Logo">
            {" "}
            <span role="img" aria-label="logo">
              üòè
            </span>{" "}
          </div>
          <div className="Title"> My Sweet App </div>
          <div>{SelectStartDate()}</div>
        </div>
      </header>
      <div className="Toolbar" />
    </div>
  );
}
